import React from "react";
import { useParams } from "react-router-dom";
import List from "../components/List";
import { getInitialData } from "../utils";

function Detail({ notesAll, setNotes }) {


    const { id } = useParams();

    // const note = notesAll.find((note) => note.id === id);

    
    const note = notesAll.filter((item) => item.id === parseInt(id)).map((note) => note);
  
    if (!note) {
      return <div>Detail not found</div>;
    }

    console.log(note[0].title)
    return (
        <div className="note-app__body">
          <h2>Detail Catatan</h2>
          <List label={note[0]?.title} setNotes={note} notes={note} />
        </div>
    );
}

export default Detail;
